use std::collections::HashMap;

use serde::Deserialize;
use serde_json::value::Value;
use smol_str::SmolStr;
use tracing::warn;

/// endpoint reponse root
#[derive(Debug, Deserialize)]
pub struct IntelResponse {
    /// "result" node
    pub result: IntelMap,
}

/// endpoint response "map" node
#[derive(Debug, Deserialize)]
pub struct IntelMap {
    /// "map" node
    pub map: HashMap<SmolStr, IntelResult>,
}

/// endpoint response "map" contents
#[derive(Debug, Deserialize)]
#[serde(untagged)]
pub enum IntelResult {
    /// error entity
    Error(IntelError),
    /// ok entity
    Entities(IntelEntities),
}

impl IntelResult {
    /// converts `IntelResult` into `Result<IntelEntities, IntelError>`
    pub fn into_result(self) -> Result<IntelEntities, IntelError> {
        match self {
            Self::Entities(e) => Ok(e),
            Self::Error(e) => Err(e),
        }
    }
}

/// endpoint error type
#[derive(Debug, Deserialize)]
pub struct IntelError {
    /// "error" node
    pub error: SmolStr,
}

/// endpoint ok type
#[derive(Debug, Deserialize)]
pub struct IntelEntities {
    /// "gameEntities" node
    #[serde(rename = "gameEntities")]
    pub entities: Vec<IntelEntity>,
}

/// endpoint main entity
/// values vary based on type
#[derive(Clone, Debug, Deserialize)]
#[serde(untagged)]
#[allow(clippy::large_enum_variant)]
pub enum IntelEntity {
    /// portal
    Portal(Entity<IntelPortal>),
    /// link
    Link(Entity<IntelLink>),
    /// field
    Field(Entity<IntelField>),
    /// anything else
    Other(Value),
}

/// struct is made of (id, timestamp, values)
#[derive(Clone, Debug, Deserialize)]
pub struct Entity<T> {
    /// entity id
    pub id: SmolStr,
    /// entity timestamp
    pub timestamp: i64,
    /// entity
    pub entity: T,
}

impl IntelEntity {
    /// transforms `&IntelEntity` into `Option<&Entity<Portal>>`
    pub fn as_portal(&self) -> Option<&Entity<IntelPortal>> {
        match self {
            Self::Portal(p) => Some(p),
            Self::Other(o) => {
                warn!("Unmapped entity: {o}");
                None
            }
            _ => None,
        }
    }

    /// transforms `IntelEntity` into `Option<Entity<Portal>>`
    pub fn into_portal(self) -> Option<Entity<IntelPortal>> {
        match self {
            Self::Portal(p) => Some(p),
            Self::Other(o) => {
                warn!("Unmapped entity: {o}");
                None
            }
            _ => None,
        }
    }

    /// transforms `&IntelEntity` into `Option<&Entity<Link>>`
    pub fn as_link(&self) -> Option<&Entity<IntelLink>> {
        match self {
            Self::Link(l) => Some(l),
            Self::Other(o) => {
                warn!("Unmapped entity: {o}");
                None
            }
            _ => None,
        }
    }

    /// transforms `IntelEntity` into `Option<Entity<Link>>`
    pub fn into_link(self) -> Option<Entity<IntelLink>> {
        match self {
            Self::Link(l) => Some(l),
            Self::Other(o) => {
                warn!("Unmapped entity: {o}");
                None
            }
            _ => None,
        }
    }

    /// transforms `IntelEntity` into `Option<Entity<Field>>`
    pub fn as_field(&self) -> Option<&Entity<IntelField>> {
        match self {
            Self::Field(f) => Some(f),
            Self::Other(o) => {
                warn!("Unmapped entity: {o}");
                None
            }
            _ => None,
        }
    }

    /// transforms `&IntelEntity` into `Option<&Entity<Field>>`
    pub fn into_field(self) -> Option<Entity<IntelField>> {
        match self {
            Self::Field(f) => Some(f),
            Self::Other(o) => {
                warn!("Unmapped entity: {o}");
                None
            }
            _ => None,
        }
    }
}

/// portal representation
#[derive(Clone, Debug, Deserialize)]
pub struct IntelPortal {
    /// needed for untagged enum
    #[allow(dead_code)]
    tag: PortalTag,
    /// faction
    pub faction: Faction,
    /// latitude
    #[serde(deserialize_with = "crate::utils::deserialize_coord")]
    pub latitude: f64,
    /// longitude
    #[serde(deserialize_with = "crate::utils::deserialize_coord")]
    pub longitude: f64,
    /// level
    pub level: u8,
    /// health
    pub health: u8,
    /// res_count
    pub res_count: u8,
    /// image
    pub image: Option<SmolStr>,
    /// title
    pub title: SmolStr,
    /// ornaments
    pub ornaments: Vec<Value>,
    /// mission
    pub mission: bool,
    /// mission_50plus
    pub mission_50plus: bool,
    /// artifact_brief
    pub artifact_brief: Value,
    /// timestamp
    pub timestamp: i64,
    /// mods
    #[serde(default)]
    pub mods: Option<[Option<IntelMod>; 4]>,
    /// resonators
    #[serde(default)]
    pub resonators: Option<Vec<IntelResonator>>,
    /// owner
    #[serde(default)]
    pub owner: Option<SmolStr>,
    /// artifact_detail
    #[serde(default)]
    pub artifact_detail: Option<Vec<Value>>,
    /// history
    #[serde(default)]
    pub history: Value,
}

/// needed for untagged enum
#[derive(Clone, Debug, Deserialize)]
#[serde(rename_all = "lowercase")]
enum PortalTag {
    P,
}

/// portal deployed mod
#[derive(Clone, Debug, Deserialize)]
pub struct IntelMod {
    /// mod owner
    pub owner: SmolStr,
    /// mod name
    pub name: SmolStr,
    /// mod rarity
    pub rarity: SmolStr,
    /// mod stats
    pub stats: Value,
}

/// portal deployed resonator
#[derive(Clone, Debug, Deserialize)]
pub struct IntelResonator {
    /// resonator owner
    pub owner: SmolStr,
    /// resonator level
    pub level: u8,
    /// resonator energy
    pub energy: u16,
}

/// field representation
#[derive(Clone, Debug, Deserialize)]
pub struct IntelLink {
    /// needed for untagged enum
    #[allow(dead_code)]
    tag: LinkTag,
    /// faction
    pub faction: Faction,
    /// origin portal id
    pub origin_portal_id: SmolStr,
    /// origin latitude
    #[serde(deserialize_with = "crate::utils::deserialize_coord")]
    pub origin_latitude: f64,
    /// origin longitude
    #[serde(deserialize_with = "crate::utils::deserialize_coord")]
    pub origin_longitude: f64,
    /// destination portal id
    pub destination_portal_id: SmolStr,
    /// destination latitude
    #[serde(deserialize_with = "crate::utils::deserialize_coord")]
    pub destination_latitude: f64,
    /// destination longitude
    #[serde(deserialize_with = "crate::utils::deserialize_coord")]
    pub destination_longitude: f64,
}

/// needed for untagged enum
#[derive(Clone, Debug, Deserialize)]
#[serde(rename_all = "lowercase")]
enum LinkTag {
    E,
}

/// field representation
#[derive(Clone, Debug, Deserialize)]
pub struct IntelField {
    /// needed for untagged enum
    #[allow(dead_code)]
    tag: FieldTag,
    /// faction
    pub faction: Faction,
    /// portals
    pub portals: [FieldPortal; 3],
}

/// needed for untagged enum
#[derive(Clone, Debug, Deserialize)]
#[serde(rename_all = "lowercase")]
enum FieldTag {
    R,
}

/// field portal representation
#[derive(Clone, Debug, Deserialize)]
pub struct FieldPortal {
    /// portal id
    pub id: SmolStr,
    /// portal latitude
    #[serde(deserialize_with = "crate::utils::deserialize_coord")]
    pub latitude: f64,
    /// portal longitude
    #[serde(deserialize_with = "crate::utils::deserialize_coord")]
    pub longitude: f64,
}

#[derive(Copy, Clone, Debug, PartialEq, Eq, Hash, Deserialize)]
/// Factions
pub enum Faction {
    /// Neutral
    #[serde(rename = "N")]
    Neutral,
    /// Enlightened
    #[serde(rename = "E")]
    Enlightened,
    /// Resistance
    #[serde(rename = "R")]
    Resistance,
    /// Machina
    #[serde(rename = "M")]
    Machina,
}

impl Faction {
    /// checks if neutral
    pub fn is_neutral(&self) -> bool {
        matches!(self, Faction::Neutral)
    }
    /// checks if enlightened
    pub fn is_enlightened(&self) -> bool {
        matches!(self, Faction::Enlightened)
    }
    /// checks if resistance
    pub fn is_resistance(&self) -> bool {
        matches!(self, Faction::Resistance)
    }
    /// checks if machina
    pub fn is_machina(&self) -> bool {
        matches!(self, Faction::Machina)
    }
}

